import React, { Component } from "react";
import "./App.css";
import { Animated } from "react-animated-css";
import Results from "./components/Results";
import Artists from "./components/TextFields/Artists";
import Movements from "./components/TextFields/Movements";
import Centuries from "./components/TextFields/Centuries";
import Branches from "./components/TextFields/Branches";

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <div className="ShowCase">
          <Animated
            animationIn="fadeInRight"
            animationOut="fadeOut"
            isVisible={true}
          >
            <h1>Museum Locale</h1>
          </Animated>
          <p>
            <strong>Your Local Museum</strong>
          </p>
        </div>
        <img
          className="Icons"
          src="https://pbs.twimg.com/profile_images/472484809390845952/al5G_CPq_400x400.jpeg"
          alt="TheMet"
        />
        <img
          className="Icons"
          src="http://blogs.newschool.edu/arts-social-engagement/files/2018/05/met.jpg"
          alt="TheMet"
        />
        <img
          className="Icons"
          src="https://upload.wikimedia.org/wikipedia/commons/f/fc/Artsy_logo.svg"
          alt="TheMet"
        />
        <Artists />
        <br />
        <Movements />
        <br />
        <Centuries />
        <Branches />
      </React.Fragment>
    );
  }
}

export default App;
